import React from "react";
import { Map, Marker, Popup, TileLayer, Polyline } from "react-leaflet";
//import { Icon } from "leaflet";
//import * as parkData from "./data/skateboard-parks.json";
import "./App.css";

/*export const icon = new Icon({
  iconUrl: "/skateboarding.svg",
  iconSize: [25, 25]
});*/
const io = require("socket.io-client")
const socket = io.connect('ws://tarea-3-websocket.2021-1.tallerdeintegracion.cl', {
    path:'/flights'
});

socket.on('FLIGHTS', function(data){
  console.log(data);
  //render(data)
});

export class Planes extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      vuelos: []
    }
  };

  componentDidMount(){
    socket.on('FLIGHTS', function(data){
      console.log(data);});

  }
  render() {}
}

export default function App() {

  const position = [35, -0.09]
  const polyline = [
    [-33.4, -70.6],
    [ 41.3, 2.1],
  ]


  return (
    <Map center={position} zoom={1}>
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
      />
      <Marker position={position}>
        <Popup>
          A pretty CSS3 popup. <br /> Easily customizable.
        </Popup>
      </Marker>
      <Polyline pathOptions={{color:'#eb42dd', weight:5}} positions={polyline} />
    </Map>
  );
}
